class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div>
          {/* <Navigation /> */}
          <Switch>
            <Route path="/" component={Search} exact />
            {/* <Route path="/about" component={About}/>
             <Route path="/contact" component={Contact}/> */}
            <Route component={Error} />
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
